// HasResultingLease applies the HasEdge predicate on the "resulting_lease" edge.
func HasResultingLease() predicate.Application {
	return predicate.Application(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2O, true, ResultingLeaseTable, ResultingLeaseColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasResultingLeaseWith applies the HasEdge predicate on the "resulting_lease" edge with a given conditions (other predicates).
func HasResultingLeaseWith(preds ...predicate.Lease) predicate.Application {
	return predicate.Application(func(s *sql.Selector) {
		step := newResultingLeaseStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

